import React, { useState } from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  const [carattSpeciali, setCarattSpeciali] = useState<boolean>(false);
  const [maiuscole, setMaiuscole] = useState<boolean>(false);
  const [numeri, setNumeri] = useState<boolean>(false);

  return (
    <div className="App">
      <h1>Analisi Sicurezza Password</h1>
      <fieldset>
        <legend>Caratteristiche</legend>
        <label>
          <input
            type="checkbox"
            name="caratt_speciali"
            checked={carattSpeciali}
            onClick={() => setCarattSpeciali(!carattSpeciali)}
          />
          Caratteri Speciali
        </label>
        <label>
          <input
            type="checkbox"
            name="maiuscole"
            checked={maiuscole}
            onClick={() => setCarattSpeciali(!maiuscole)}
          />
          Maiuscole
        </label>
        <label>
          <input
            type="checkbox"
            name="numeri"
            checked={numeri}
            onClick={() => setCarattSpeciali(!numeri)}
          />
          Numeri
        </label>
      </fieldset>
      <input className="input_normale" type="number" placeholder='Lunghezza' />
      <button>Calcola</button>
    </div>
  );
}

export default App;
